import React from 'react'
import Tasks from './Tasks'

const Task = ({task,deletetask,toggle}) => {

  return (
    <>
    {
      task.map((task)=>(
        <Tasks key={task.id} task={task} deletetask={deletetask} toggle={toggle}/>
      ))
    }
    
    </>
  )
}

export default Task
